drawVisualiser = (bufferLength, x, barWidth, barHeight, dataArray) => {
    for (let i = 0; i < bufferLength; i++) {
        barHeight = canvas.height;
        const red = dataArray[i] * 5;
        const green = dataArray[i] * 1;
        const blue = 200
        let alpha = dataArray[i] * 0.004;
        ctx.fillStyle = 'rgba(' + red + ',' + green + ',' + blue + ',' + alpha + ')';
        ctx.fillRect(canvas.width * 0.5 - x, canvas.height - barHeight, barWidth * 0.2, barHeight);
        ctx.fillRect(canvas.width * 0.5 + x, canvas.height - barHeight, barWidth * 0.2, barHeight);
        x += barWidth;
    }
}